import React, { Component } from "react";
class ListGroup extends React.Component {
  render() {
    return (
      <ul className="list-group">
        <li className="list-group-item active"></li>
        <li className="list-group-item "></li>
        <li className="list-group-item "></li>
        <li className="list-group-item "></li>
      </ul>
    );
  }
}

export default ListGroup;
